import { TodoCounter } from './TodoCounter';
import { TodoSearch } from './TodoSearch';
import { TodoList } from './TodoList';
import { CreateTodoButton } from './CreateTodoButton';
import './App.css';
import { TodoItem } from './TodoItem';

const defaultTodos = [
	{ text: 'Find a problem people have', completed: false },
	{ text: 'Come up with an innovative solution a problem', completed: false },
	{ text: 'Gain first 3 customers', completed: false },
	{ text: 'Launch a million dollar business', completed: false },
];

function App() {
	return (
		<>
			<TodoCounter
				completed={3}
				total={6}
			/>
			<TodoSearch />
			<CreateTodoButton />
			<TodoList>
				{defaultTodos.map((todo) => (
					<TodoItem
						key={todo.text}
						text={todo.text}
						completed={todo.completed}
					/>
				))}
			</TodoList>
		</>
	);
}

export default App;
